import React from 'react'
import './../index.css';

function New() {
  return (
        <div className='new-form'>
          <ul id='new-form' className='new-form-list'>
            <li><input id='new-ip' className='form-input new-form-input' placeholder='IP Address'></input></li>
            <li><input id='new-ip-name' className='form-input new-form-input' placeholder='Name'></input></li>
            <li><input id='new-ip-subnet' className='form-input new-form-input' placeholder='Subnet'></input></li>
            <li><textarea id='new-ip-comment' className='new-form-input new-ip-comment' placeholder='Comments'></textarea></li>
            <li><button id='new-save' className='new-form-button'>Save</button></li>
          </ul>
        </div>
  )
}

export default New
